import './App.css';
import FlipCoin from './components/FlipCoin.js'
import React, { Component } from 'react'

class App extends Component {
  render() {
    return (
      <div className="App" >
        <div>
          <h1>Let's flip a coin!</h1>
          <FlipCoin></FlipCoin>

        </div>
      </div>
    );
  }
}
export default App;
